import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { getUser, removeUserSession, getToken } from '../utils/common';
import axios from 'axios';

const Dashboard = props => {
  const history = useNavigate();
  const user = getUser();
  const [error, setError] = useState(null);
  const [loading, setLoading] = useState(false);
  const [transactions, setTransaction] = useState([]);

  useEffect(() => {
    const token = getToken();
    if (!token) {
      return;
    }

    axios.post('https://jp-dev.cityremit.global/web-api/transaction-manager/v1/admin/dashboard/search', {},
      {
        headers: {
          'Content-Type': 'application/json',
          'Authorization': `Bearer ${token}`
        },
      }).then(response => {
        setTransaction(response.data["data"])
      }).catch(error => {
        setLoading(false);
        if (error.response?.status === 403) setError(error.response.data.message);
        else setError("Something went wrong. Please try again later.");
      });
  }, []);

  // handle click event of logout button
  const handleLogout = () => {
    removeUserSession();
    history('/login');
  }

  return (
    <>
      <style>{`
    table, td, tr, th{
     border:1px solid black;
    }
  `}</style>
      <div>
        Welcome {user}!<br /><br />
        <input type="button" onClick={handleLogout} value="Logout" />
        <br />
        <br />
        <div>
          {
            transactions.length > 0 ?
            <>
             <table>
                <tr>
                  <th>Current Status</th>
                  <th>Receive Amount
                  </th>
                  <th>Receive Country
                  </th>
                  <th>Receiver Full Name</th>
                  <th>Send Amount
                  </th>
                  <th>Send Country
                  </th>
                  <th>Sender Full Name</th>
                </tr>
                {
                  transactions.map((data, index) => {
                    return (
                      <>
                        <tr key={index}>
                          <td>{data["Current Status"]}</td>
                          <td>{data["Receive Amount/受取金額"]}</td>
                          <td>{data["Receive Country/受取国"]}</td>
                          <td>{data["Receiver Full Name"]}</td>
                          <td>{data["Send Amount/送金額"]}</td>
                          <td>{data["Send Country/送金国"]}</td>
                          <td>{data["Sender Full Name"]}</td>
                        </tr>
                      </>
                    )
                  })
                }
              </table>

<div class="relative overflow-x-auto">
    <table class="w-full text-sm text-left text-gray-500 dark:text-gray-400">
        <thead class="text-xs text-gray-700 uppercase bg-gray-50 dark:bg-gray-700 dark:text-gray-400">
            <tr>
                <th scope="col" class="px-6 py-3">
                    Product name
                </th>
                <th scope="col" class="px-6 py-3">
                    Color
                </th>
                <th scope="col" class="px-6 py-3">
                    Category
                </th>
                <th scope="col" class="px-6 py-3">
                    Price
                </th>
            </tr>
        </thead>
        <tbody>
            <tr class="bg-white border-b dark:bg-gray-800 dark:border-gray-700">
                <th scope="row" class="px-6 py-4 font-medium text-gray-900 whitespace-nowrap dark:text-white">
                    Apple MacBook Pro 17"
                </th>
                <td class="px-6 py-4">
                    Silver
                </td>
                <td class="px-6 py-4">
                    Laptop
                </td>
                <td class="px-6 py-4">
                    $2999
                </td>
            </tr>
            <tr class="bg-white border-b dark:bg-gray-800 dark:border-gray-700">
                <th scope="row" class="px-6 py-4 font-medium text-gray-900 whitespace-nowrap dark:text-white">
                    Microsoft Surface Pro
                </th>
                <td class="px-6 py-4">
                    White
                </td>
                <td class="px-6 py-4">
                    Laptop PC
                </td>
                <td class="px-6 py-4">
                    $1999
                </td>
            </tr>
            <tr class="bg-white dark:bg-gray-800">
                <th scope="row" class="px-6 py-4 font-medium text-gray-900 whitespace-nowrap dark:text-white">
                    Magic Mouse 2
                </th>
                <td class="px-6 py-4">
                    Black
                </td>
                <td class="px-6 py-4">
                    Accessories
                </td>
                <td class="px-6 py-4">
                    $99
                </td>
            </tr>
        </tbody>
    </table>
</div>

            </>

              : <></>
          }
        </div>
      </div >
    </>

  );
}

export default Dashboard;
